import React from 'react';
import './style/navbar.css';
import { NavLink } from 'react-router-dom';
const Navbar=()=>{
    return(
        <div className="navbar">
            <div className="one"></div>
            <p>Inshorts<br/><span>jijsksssssssssss</span></p>
            <li><NavLink className="links" to='/home'>Home</NavLink></li>
            <li><NavLink className="links" to='/contact'>Contact</NavLink></li>
            <li><NavLink className="links" to='/about'>About</NavLink></li>
            <li><NavLink className="links" to='/login'>Login</NavLink></li>
            <li><NavLink className="links" to='/signup'>Register</NavLink></li>    
        </div>
    )
}

export default Navbar;
